import React from 'react';
import PropTypes from 'prop-types';

const PersonList = ({ persons }) => {
  return (
    <React.Fragment>
      <h2>All Persons</h2>

      <table>
          <thead>
              <tr><th>ID</th><th>NAVN</th></tr></thead>
          <tbody>
        {persons.map(person => (
          <tr key={person.id}><td>{person.id}</td><td>{person.name}</td></tr>
        ))}
        </tbody>
      </table>
    </React.Fragment>
  );
};
export default PersonList;

PersonList.propTypes = {
  persons: PropTypes.array
}
